export async function getServerSideProps() {
  const { user } = useContext(AuthContext);
  console.log(user);
  const res = await Promise.all([fetch(`${API_URL}/backend/api/v1/users/${user.data._id}`)]);

  const info = await Promise.all(res.map((res) => res.json()));
  console.log(info[0]);
  return {
    props: {
      token,
      person: info[0],
    },
  };
}
